import React, { useState } from 'react';
import './Navbar.css';
import logo from '../assets/logo.png';

// Images explicatives
import regles1 from '../assets/regles/A4 - 1.png';
import regles2 from '../assets/regles/A4 - 2.png';
import regles3 from '../assets/regles/A4 - 3.png';
import regles4 from '../assets/regles/A4 - 4.png';
import regles5 from '../assets/regles/A4 - 5.png';
import regles6 from '../assets/regles/A4 - 6.png';
import regles7 from '../assets/regles/A4 - 7.png';
import regles8 from '../assets/regles/A4 - 8.png';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isreglesOpen, setIsreglesOpen] = useState(false);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const openregles = () => {
    setIsreglesOpen(true);
  };

  const closeregles = () => {
    setIsreglesOpen(false);
  };

  const openGuide = () => setIsGuideOpen(true);
  const closeGuide = () => setIsGuidesOpen(false);

  return (
    <>
      <nav className="navbar">
        <div className="navbar-left">
          <button className="menu-button" onClick={toggleMenu}>
            ☰ Menu
          </button>
          {isMenuOpen && (
            <div className="dropdown-menu">
              <a href="/Login"><button>Mon compte</button></a>
              <button>Présentation du jeu</button>
              <button>Fonctionnalités</button>
              <button>À propos de nous</button>
              <a href="/"><button>Quitter</button></a>
            </div>
          )}
          <img src={logo} alt="Cyber@Hack" className="logo" />
          <span className="game-name">Cyber@Hack</span>
        </div>
        <div className="navbar-right">
          <a href="/"><button>Accueil</button></a>
          <span>|</span>
          <button onClick={openregles}>Règles du jeu</button>
          <span>|</span>
          <button onClick={openGuide}>Guide</button>
          <span>|</span>
          <a href="/Login"><button>Compte</button></a>
        </div>
      </nav>

      {/* Fenêtre modale */}
      {isreglesOpen && (
        <div className="modal-overlay" onClick={closeregles}>
          <div className="modal-content" onClick={(e) => e.stopPropagation()}>
            <span className="close-button" onClick={closeregles}>✖</span>
            <h2>regles du jeu</h2>
            <div className="regles-images">
              <img src={regles1} alt="regles étape 1" />
              <img src={regles2} alt="regles étape 2" />
              <img src={regles3} alt="regles étape 3" />
              <img src={regles4} alt="regles étape 4" />
              <img src={regles5} alt="regles étape 5" />
              <img src={regles6} alt="regles étape 6" />
              <img src={regles7} alt="regles étape 7" />
              <img src={regles8} alt="regles étape 8" />
            </div>
          </div>
        </div>
      )}

      {/* Modale GUIDE */}
      {isRulesOpen && (
        <div className="modal-overlay" onClick={closeGuide}>
          <div className="modal-content" onClick={(e) => e.stopPropagation()}>
            <span className="close-button" onClick={closeGuide}>✖</span>
            <h2>Guide du jeu</h2>
            <div className="guide-grid">
              <div className="guide-box">Cartes Attaque</div>
              <div className="guide-box">Cartes Bouclier</div>
              <div className="guide-box">Cartes Secteur</div>
              <div className="guide-box">Cartes Événement</div>
            </div>
          </div>
        </div>
      )}

    </>
  );
};

export default Navbar;
